import { Route } from "react-router";
import Welcome from "./Components/Welcome";
import Users from "./Pages/Users";

function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/users">
        <Users />
      </Route>
    </div>
  );
}

export default App;
